const t="2024",e=[{month:5,diaryList:[{name:"雨析",supplement:"#古今如梦，何曾梦觉，但有旧欢新怨。",content:"停电了，去公园溜达了一圈，坐在长椅上看了好久规律波动的湖水，想了很多乱七八糟的东西，直到落日的余晖渐渐褪去还是没能让自己静下来。一定要静下来，静下来啊！",publishTime:1715782011495},{name:"雨析",supplement:"又又又迷路了...🙁",content:"连日的阴雨绵绵后，今日的傍晚终于迎来了久违的夕阳。满脸疲惫的他拿出手机娴熟的戴上耳机打开音乐和地图，无精打采的来到一辆单车前，望着夕阳他出发了。<br/>初夏的晚风伴着淡淡的桂花香在人群中肆意嬉闹，他脸上的疲态也在慢慢消退，加速加速再加速，他一路狂奔，赶在红灯前来到路口甚至超过了许多小电驴。<br/>突然耳机里的导航声消失了他皱了皱眉，本该平静的行程泛起了一丝涟漪。拿出手机看了看果然没电了，这意味着他迷路了...努力得回忆着刚打开地图是上面的轨迹他一脸沉重的重新出发了。咣！毫无征兆的随着一声响雷，雨水像蓄满力的弓弦上疾驰而出的利箭直插地面，他艰难的睁开眼望了望四周似乎无处避雨，只能硬着头皮继续前行了。<br/>最后他路过一个小店遇到好心的老板给他手机充了电避了一会儿雨，本来剩7分钟的路程他骑了半个多小时，迷路真让人难过。🙁",publishTime:1714913931344}]},{month:3,diaryList:[{name:"雨析",supplement:"#无善无恶心之体，有善有恶意之动。知善知恶是良知，为善去恶是格物。",content:"😐😐😐",publishTime:1709278236925}]}],n={year:t,monthList:e};export{n as default,e as monthList,t as year};
